    render() {
        return (
            <div id ="LoginWrapper">
                <Card id="LoginCard">
                    <Form class="LoginForm">
                        <img src={Logo} alt="Logo" class="Logo"/>
                        <h2 id='loginH2'>Login</h2>
                            <Form.Group className="mb-3" controlId="formBasicEmail" class="form-group">
                                <Row>
                                    <Col>
                                        <Form.Label class="formLabel">Email</Form.Label> 
                                        <Form.Control type="email" placeholder="" className="form-control" />
                                    </Col>
                                </Row>
                            </Form.Group>


                            <Form.Group className="mb-3" controlId="formBasicPassword" class="form-group">
                                <Row>
                                    <Col>
                                        <Form.Label class="formLabel">Password</Form.Label>
                                        <Form.Control type="password" placeholder="" className="form-control"/>
                                    </Col>
                                </Row>
                    </Form.Group>

                        <Button className="LoginBtn" variant="primary" type="submit" onClick={this
                        .submitLogin.bind(this)}>
                        SignUp </Button>

                        <div id="ForgotPassword"><a href='#'><b>Forgot password?</b></a></div>
                        <div id="SignUpLink">Need an account?&nbsp;<Link to="/SignUp"><b>Sign Up</b></Link></div>
                    </Form>
                </Card> 
            </div>    
        );
    }
}

export default LoginForm;
